fields.description:
В ходе юзабилити-тестирования приложения Android Tablet (8-ью людьми на одном планшете Samsung Galaxy Tab 10.1 на базе Android 3.1.) были обнаружены критичные технические сбои в ходе покупки: 

1. Трое из восьми не смогли купить фильм, потому что кнопка "Купить" не реагировала; 
2. Один респондент купил подписку, но через некоторое время ему предложили купить подписку снова; 
3. Респондент дошёл до последнего шага операции оплаты, оплатил, но значок купить не поменялся на значок смотреть. 
    второй раз респондент не стал повторять процедуру оплаты, опасаясь, что может купить одну и туже услугу дважды.

нужно проресерчить, в чем могут заключаться подобные проблемы и как можно оптимизировать процесс покупки.
